import styles from '../styles.module.css';
const Home = () => {
  return (
    <div>
      <div className={styles.index - left - container}>
        <div className={styles.index - left - image}></div>
        <div className={styles.index - left - card}></div>
      </div>
    </div>
  );
};

export default Home;
